update system_settings set config_value = '<html>
<head>
    <title>Meldungen zur Ihren Teststellen</title>
    <meta charset="UTF-8">
</head>
<body>
Sehr geehrte Damen und Herren,<br><br>
uns wurde von einem Nutzer des Schnelltestsuchportals ein Fehler für Ihre Teststelle gemeldet:<br>

<br>
{{range $center, $reports := .Centers}}Meldungen für die Teststelle {{(index $reports 0).CenterName}} ({{(index $reports
0).CenterAddress}})<br>
<ul>
    {{range $reportUUID, $report := $reports}}
    <li>{{$report.Subject}} {{if $report.Message}}(Hinweis: {{$report.Message}}){{end}} (Gemeldet am
        {{$report.Created}}){{end}}
    </li>
</ul>
<br>
{{end}}
<br>

Bitte überprüfen Sie im <a href="https://schnelltestportal.de/qt/">Schnelltestportal</a> unter „Benutzerverwaltung –
Teststelle bearbeiten“ Ihre Einträge.<br>
Wenn nötig, korrigieren Sie diese bitte. Sollte aus <span style="text-decoration: underline">Ihrer</span> Sicht hier
alles korrekt sein, können Sie diese Mail ignorieren.<br>


<img style="margin-bottom: 10px"
     src="data:image/png;base64,"/>
<br>
<br>
<img src="data:image/png;base64,"/>
</body>
</html>' where config_key = 'reports.email.template';